[{'comment_id': 458896944, 'comment_body': '`save_config` name implies that the function actually write something on disk.
Intuitively, I would expect:`save_config(path: str) -> None` and it would be consistent with `save_metadata`.
', 'comment_created': datetime.datetime(2020, 7, 22, 15, 51, 58, tzinfo=datetime.timezone.utc), 'commenter': 'Conchylicultor', 'type': 'User'}, {'comment_id': 458900838, 'comment_body': 'It's a draft so you'll probably had plan for it. In addition of the info, we should also save the feature type.

I would suggest implementing something like: https://github.com/tensorflow/datasets/pull/2167/files#diff-9fbfec231798aaac7105e45f88153dffR47

Using `__init_subclass__`, you register a mapping `str` -> `FeatureConnector`.

Then in `save_config`, you can save the `type(self).__name__`.

```json
{
    "type": "FeatureDict",
    "content": {
        "image": {
            "type": "Image",
            "shape": [null, null, 3],
            ...,
        },
        "label": {
            "type": "ClassLabel",
        },
    },
}
```

Then in addition of `save_config` / `from_config`, you could have `from_json` / `to_json`:

```py
@classmethod
def from_json(cls) -> FeatureConnnector:
  # Implementation inspired from https://github.com/tensorflow/datasets/pull/2167/files#diff-9fbfec231798aaac7105e45f88153dffR72

def to_json(self) -> Json:
  ...

@classmethod
def from_config(cls, path: str):
  with tf.io.gfile.GFile(path) as f:
    return FeatureConnector.from_json(json.loads(f.read()))

def save_config(self, path: str):
  with tf.io.gfile.GFile(path, 'w') as f:
    return json..dumps(path, self.to_json())
```
