", 'comment_created': datetime.datetime(2020, 7, 30, 20, 35, 19, tzinfo=datetime.timezone.utc), 'commenter': 'Conchylicultor', 'type': 'User'}, {'comment_id': 463261093, 'comment_body': "I think the kwarg should be `data_dir`, so the builder_cls know where to load the config, but I haven't though deeply yet about this.", 'comment_created': datetime.datetime(2020, 7, 30, 20, 46, 12, tzinfo=datetime.timezone.utc), 'commenter': 'Conchylicultor', 'type': 'User'}, {'comment_id': 463283687, 'comment_body': "Just for info, you're returning a `dict`, but the return type should be `FeatureConnector`", 'comment_created': datetime.datetime(2020, 7, 30, 21, 32, 45, tzinfo=datetime.timezone.utc), 'commenter': 'Conchylicultor', 'type': 'User'}, {'comment_id': 463286459, 'comment_body': "The `type` field seems to be duplicated across all features. As this is how feature class are detected, I think it is important to automate this field.

I think we should have two method `from_json` and `from_json_content`. Here is my proposal:

The `FeatureConnector` implement the 4 methods:

```py
def from_json(cls, value) -> 'FeatureConnector':
  subclass = cls._REGISTERED_FEATURES.get(value['type'])
  return subclass.from_json_content(value['content'])

def to_json(self, value):
  return {
      'type': type(self).__name__,
      'content': self.to_json_content(),
  }
  
  

def from_json_content(cls, value):
  return cls(**value)

def to_json_content(cls, value):
  return {}
```

Then subclasses would only implement the `to_json_content` and `from_json_content` optionally.

